LECTURE: Sequences are made up of one or more turns. A turn is a set of instructions.
A sequence has four parts:
the first number, which tells you how many turns the sequence has;
the instruction that comes after the turn;
the second number, which tells you the order of the instructions; and
the instruction that comes before the turn.
For example, consider the sequence 2. 5. 5. The parts of the sequence are:
the first number, 2, which tells you that the sequence has two turns;
the instruction that comes after the turn, 5, which tells you to add 5 to the number you are considering;
the second number, 5, which tells you the order of the instructions; and
the instruction that comes before the turn, 5, which tells you to add 5 to the number you are considering.
SOLUTION: The sequence is incomplete. It is missing a second number.
